B.a1J=s(["\u0648\u0633\u0637 \u0631\u0627\u0647\u06cc. \u062f\u0642\u06cc\u0642\u0627\u064b \u062c\u0627\u06cc\u06cc \u06a9\u0647 \u062e\u06cc\u0644\u06cc\u0627 \u06a9\u0645 \u0645\u06cc\u0627\u0631\u0646. \u062a\u0648 \u06a9\u0645 \u0646\u06cc\u0627\u0631.","\u0627\u0646\u0631\u0698\u06cc\u200c\u0627\u062a \u06a9\u0645 \u0634\u062f\u0647\u061f \u06cc\u0627\u062f\u062a \u0628\u06cc\u0627\u0631 \u0686\u0631\u0627 \u0634\u0631\u0648\u0639 \u06a9\u0631\u062f\u06cc.","\u0645\u0647\u0645 \u0646\u06cc\u0633\u062a \u0686\u0642\u062f\u0631 \u0622\u0647\u0633\u062a\u0647 \u0645\u06cc\u0631\u06cc\u060c \u0645\u0647\u0645 \u0627\u06cc\u0646\u0647 \u06a9\u0647 \u0645\u062a\u0648\u0642\u0641 \u0646\u0634\u06cc.","\u0627\u0644\u0627\u0646 \u0648\u0642\u062a \u062c\u0627 \u0632\u062f\u0646 \u0646\u06cc\u0633\u062a. \u0627\u0644\u0627\u0646 \u0648\u0642\u062a \u0628\u06cc\u0634\u062a\u0631 \u062a\u0644\u0627\u0634 \u06a9\u0631\u062f\u0646\u0647.","\u0648\u0642\u062a\u06cc \u062d\u0633 \u0645\u06cc\u200c\u06a9\u0646\u06cc \u0647\u0645\u0647\u200c\u0686\u06cc \u0633\u062e\u062a\u0647\u060c \u06cc\u0639\u0646\u06cc \u062f\u0627\u0631\u06cc \u067e\u06cc\u0634\u0631\u0641\u062a \u0645\u06cc\u200c\u06a9\u0646\u06cc.","\u0627\u0648\u062c \u06af\u0631\u0641\u062a\u0646\u060c \u0647\u0645\u06cc\u0634\u0647 \u0628\u0639\u062f \u0627\u0632 \u0633\u062e\u062a\u200c\u062a\u0631\u06cc\u0646 \u0641\u0634\u0627\u0631\u0647\u0627 \u0627\u062a\u0641\u0627\u0642 \u0645\u06cc\u200c\u0627\u0641\u062a\u0647.","\u0628\u0647 \u062e\u0648\u062f\u062a \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u0628\u062f\u0647\u060c \u0627\u0645\u0627 \u0628\u0647 \u062e\u0648\u062f\u062a \u0645\u0631\u062e\u0635\u06cc \u0646\u062f\u0647.","\u06a9\u06cc\u0641\u06cc\u062a \u0645\u0637\u0627\u0644\u0639\u0647 \u0627\u0645\u0631\u0648\u0632\u062a\u060c \u06a9\u06cc\u0641\u06cc\u062a \u0632\u0646\u062f\u06af\u06cc \u0641\u0631\u062f\u0627\u062a \u0631\u0648 \u062a\u0639\u06cc\u06cc\u0646 \u0645\u06cc\u200c\u06a9\u0646\u0647.","\u0627\u062c\u0627\u0632\u0647 \u0646\u062f\u0647 '\u062d\u0633 \u0648 \u062d\u0627\u0644' \u062f\u0631\u0633 \u062e\u0648\u0646\u062f\u0646\u062a \u0631\u0648 \u0645\u062f\u06cc\u0631\u06cc\u062a \u06a9\u0646\u0647. \u062a\u0648 \u0645\u062f\u06cc\u0631\u06cc\u062a\u0634 \u06a9\u0646.","\u0631\u0648\u06cc\u0627\u0647\u0627\u062a \u0645\u0646\u062a\u0638\u0631\u0646. \u062d\u0642 \u0646\u062f\u0627\u0631\u06cc \u062e\u0633\u062a\u0647 \u0634\u06cc.","\u0635\u062f\u0627\u06cc \u062e\u0631\u062f \u0634\u062f\u0646 \u062a\u0646\u0628\u0644\u06cc\u200c\u0647\u0627\u062a \u0631\u0648 \u0645\u06cc\u200c\u0634\u0646\u0648\u06cc\u061f \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u0647.","\u062f\u0631\u062f \u0645\u0648\u0642\u062a\u06cc\u0647\u060c \u0627\u0645\u0627 \u0627\u0641\u062a\u062e\u0627\u0631 \u062f\u0627\u0626\u0645\u06cc.","\u0627\u06cc\u0646 \u0631\u0648\u0632\u0647\u0627 \u0647\u0645 \u0645\u06cc\u200c\u06af\u0630\u0631\u0646\u060c \u0627\u0645\u0627 \u0646\u062a\u06cc\u062c\u0647\u200c\u0627\u0634 \u0628\u0627 \u062a\u0648 \u0645\u06cc\u200c\u0645\u0648\u0646\u0647.","\u0627\u0632 \u062f\u0633\u062a\u0627\u0648\u0631\u062f\u0647\u0627\u06cc \u06a9\u0648\u0686\u06cc\u06a9\u062a \u0647\u0645 \u062e\u0648\u0634\u062d\u0627\u0644 \u0634\u0648. \u0647\u0631 \u062a\u0633\u062a \u062f\u0631\u0633\u062a\u060c \u06cc\u06a9 \u067e\u06cc\u0631\u0648\u0632\u06cc\u0647.","\u0645\u0633\u06cc\u0631\u06cc \u06a9\u0647 \u0627\u0644\u0627\u0646 \u062a\u0648\u0634 \u0647\u0633\u062a\u06cc\u060c \u0647\u0632\u0627\u0631\u0627\u0646 \u0646\u0641\u0631 \u0642\u0628\u0644 \u0627\u0632 \u062a\u0648 \u0628\u0627 \u0645\u0648\u0641\u0642\u06cc\u062a \u0631\u0641\u062a\u0646. \u062a\u0648 \u0647\u0645 \u0645\u06cc\u200c\u062a\u0648\u0646\u06cc.","\u0642\u0647\u0631\u0645\u0627\u0646\u200c\u0647\u0627 \u062a\u0648\u06cc \u0631\u0648\u0632\u0647\u0627\u06cc \u0633\u062e\u062a \u0633\u0627\u062e\u062a\u0647 \u0645\u06cc\u0634\u0646\u060c \u0646\u0647 \u0631\u0648\u0632\u0647\u0627\u06cc \u0631\u0627\u062d\u062a.","\u0627\u06af\u0647 \u062e\u0633\u062a\u0647 \u0634\u062f\u06cc\u060c \u06cc\u0627\u062f \u0628\u06af\u06cc\u0631 \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u06a9\u0646\u06cc\u060c \u0646\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u062a\u0633\u0644\u06cc\u0645 \u0628\u0634\u06cc.","\u062f\u0642\u06cc\u0642\u0627\u064b \u062f\u0631 \u0644\u062d\u0638\u0647\u200c\u0627\u06cc \u06a9\u0647 \u0645\u06cc\u200c\u062e\u0648\u0627\u06cc \u062a\u0633\u0644\u06cc\u0645 \u0628\u0634\u06cc\u060c \u0628\u0647 \u0627\u06cc\u0646 \u0641\u06a9\u0631 \u06a9\u0646 \u06a9\u0647 \u0686\u0642\u062f\u0631 \u0628\u0647 \u0647\u062f\u0641\u062a \u0646\u0632\u062f\u06cc\u06a9\u06cc.","\u062b\u0628\u0627\u062a \u0642\u062f\u0645\u060c \u0627\u0632 \u0633\u0631\u0639\u062a \u06af\u0631\u0641\u062a\u0646 \u0645\u0647\u0645\u200c\u062a\u0631\u0647. \u062b\u0627\u0628\u062a \u0642\u062f\u0645 \u0628\u0627\u0634.","\u0627\u062c\u0627\u0632\u0647 \u0646\u062f\u0647 \u06cc\u06a9 \u0631\u0648\u0632 \u0628\u062f\u060c \u0627\u06cc\u0646 \u062d\u0633 \u0631\u0648 \u0628\u0647\u062a \u0628\u062f\u0647 \u06a9\u0647 \u0632\u0646\u062f\u06af\u06cc \u0628\u062f\u06cc \u062f\u0627\u0631\u06cc.","\u0645\u0648\u0641\u0642\u06cc\u062a\u060c \u0645\u062c\u0645\u0648\u0639\u0647\u200c\u0627\u06cc \u0627\u0632 \u062a\u0644\u0627\u0634\u200c\u0647\u0627\u06cc \u06a9\u0648\u0686\u06cc\u06a9\u0647 \u06a9\u0647 \u0647\u06cc\u0686\u06a9\u0633 \u0646\u0645\u06cc\u200c\u0628\u06cc\u0646\u0647.","\u0641\u0642\u0637 \u062a\u0648 \u0645\u06cc\u200c\u062f\u0648\u0646\u06cc \u0686\u0642\u062f\u0631 \u062f\u0627\u0631\u06cc \u0632\u062d\u0645\u062a \u0645\u06cc\u200c\u06a9\u0634\u06cc. \u0628\u0647 \u062e\u0648\u062f\u062a \u0627\u0641\u062a\u062e\u0627\u0631 \u06a9\u0646.","\u0648\u0642\u062a\u06cc \u0627\u0646\u06af\u06cc\u0632\u0647\u200c\u0627\u062a \u062a\u0645\u0648\u0645 \u0645\u06cc\u0634\u0647\u060c \u0627\u0646\u0636\u0628\u0627\u0637 \u0628\u0627\u06cc\u062f \u062c\u0627\u0634 \u0631\u0648 \u0628\u06af\u06cc\u0631\u0647.","\u0647\u0631 \u0631\u0648\u0632\u06cc \u06a9\u0647 \u062f\u0631\u0633 \u0645\u06cc\u200c\u062e\u0648\u0646\u06cc\u060c \u062f\u0627\u0631\u06cc \u0622\u06cc\u0646\u062f\u0647\u200c\u0627\u062a \u0631\u0648 \u0628\u06cc\u0645\u0647 \u0645\u06cc\u200c\u06a9\u0646\u06cc.","\u0627\u0632 \u0645\u0646\u0637\u0642\u0647\u200c\u06cc \u0627\u0645\u0646 \u062e\u0648\u062f\u062a \u0628\u06cc\u0627 \u0628\u06cc\u0631\u0648\u0646. \u0631\u0634\u062f \u0648\u0627\u0642\u0639\u06cc \u0627\u0648\u0646\u062c\u0627\u0633\u062a.","\u0634\u06a9\u0633\u062a \u062e\u0648\u0631\u062f\u0646 \u062a\u0631\u0633\u0646\u0627\u06a9 \u0646\u06cc\u0633\u062a. \u062a\u0631\u0633\u0646\u0627\u06a9\u060c \u062a\u0644\u0627\u0634 \u0646\u06a9\u0631\u062f\u0646\u0647.","\u062a\u0648 \u062f\u0631 \u062d\u0627\u0644 \u0631\u0642\u0627\u0628\u062a \u0628\u0627 \u06a9\u0633\u06cc \u062c\u0632 \u06af\u0630\u0634\u062a\u0647 \u062e\u0648\u062f\u062a \u0646\u06cc\u0633\u062a\u06cc.","\u0647\u0645\u06cc\u0646 \u0627\u0644\u0627\u0646\u060c \u0631\u0642\u06cc\u0628 \u062a\u0648 \u062f\u0627\u0631\u0647 \u062f\u0631\u0633 \u0645\u06cc\u200c\u062e\u0648\u0646\u0647. \u062a\u0648 \u0686\u06cc\u061f","\u0627\u062c\u0627\u0632\u0647 \u0646\u062f\u0647 \u0635\u062f\u0627\u06cc \u0634\u06a9\u060c \u0628\u0644\u0646\u062f\u062a\u0631 \u0627\u0632 \u0635\u062f\u0627\u06cc \u0628\u0627\u0648\u0631\u062a \u0628\u0627\u0634\u0647.","\u062a\u0648 \u062e\u06cc\u0644\u06cc \u0642\u0648\u06cc\u200c\u062a\u0631 \u0627\u0632 \u0686\u06cc\u0632\u06cc \u0647\u0633\u062a\u06cc \u06a9\u0647 \u0641\u06a9\u0631 \u0645\u06cc\u200c\u06a9\u0646\u06cc. \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u0647.","\u0648\u0633\u0637 \u0627\u0642\u06cc\u0627\u0646\u0648\u0633\u06cc. \u0646\u0647 \u0633\u0627\u062d\u0644 \u0645\u0628\u062f\u0627 \u067e\u06cc\u062f\u0627\u0633\u062a \u0646\u0647 \u0645\u0642\u0635\u062f. \u0641\u0642\u0637 \u0634\u0646\u0627 \u06a9\u0646.","\u062e\u0633\u062a\u06af\u06cc \u06cc\u0639\u0646\u06cc \u062f\u0627\u0631\u06cc \u0627\u0632 \u0645\u0646\u0637\u0642\u0647 \u0627\u0645\u0646\u062a \u062e\u0627\u0631\u062c \u0645\u06cc\u0634\u06cc. \u0627\u06cc\u0646 \u062e\u0648\u0628\u0647.","\u0648\u0642\u062a\u06cc \u0647\u0645\u0647 \u062a\u0631\u0645\u0632 \u0645\u06cc\u200c\u0632\u0646\u0646\u060c \u062a\u0648 \u06af\u0627\u0632 \u0628\u062f\u0647.","\u0632\u0645\u0633\u062a\u0648\u0646\u0650 \u06a9\u0646\u06a9\u0648\u0631 \u0633\u0631\u062f\u0647\u060c \u0648\u0644\u06cc \u0628\u0647\u0627\u0631\u0650 \u062f\u0627\u0646\u0634\u06af\u0627\u0647 \u06af\u0631\u0645\u0647.","\u0628\u0647 \u062c\u0627\u06cc \u0627\u06cc\u0646\u06a9\u0647 \u0646\u06af\u0631\u0627\u0646 \u0646\u062a\u06cc\u062c\u0647 \u0628\u0627\u0634\u06cc\u060c \u0646\u06af\u0631\u0627\u0646\u0650 \u062a\u0644\u0627\u0634 \u0646\u06a9\u0631\u062f\u0646\u062a \u0628\u0627\u0634.","\u0627\u06af\u0647 \u0642\u0631\u0627\u0631 \u0628\u0648\u062f \u0622\u0633\u0648\u0646 \u0628\u0627\u0634\u0647\u060c \u0627\u0644\u0627\u0646 \u0647\u0645\u0647 \u062f\u06a9\u062a\u0631 \u0648 \u0645\u0647\u0646\u062f\u0633 \u0628\u0648\u062f\u0646.","\u062a\u0648 \u0642\u0648\u06cc\u200c\u062a\u0631 \u0627\u0632 \u0627\u0648\u0646 \u062a\u0633\u062a\u0650 \u0644\u0639\u0646\u062a\u06cc \u0647\u0633\u062a\u06cc \u06a9\u0647 \u063a\u0644\u0637 \u0632\u062f\u06cc.","\u0627\u0634\u06a9\u0627\u0644\u06cc \u0646\u062f\u0627\u0631\u0647 \u0627\u06af\u0647 \u062e\u0633\u062a\u0647\u200c\u0627\u06cc. \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u06a9\u0646\u060c \u0648\u0644\u06cc \u062c\u0627 \u0646\u0632\u0646.","\u0647\u0631 \u0627\u0641\u062a \u062a\u0631\u0627\u0632\u060c \u06cc\u0647 \u062f\u0631\u0633 \u0628\u0632\u0631\u06af\u0647. \u06cc\u0627\u062f \u0628\u06af\u06cc\u0631 \u0648 \u0628\u0631\u0648 \u062c\u0644\u0648.","\u0645\u0633\u06cc\u0631 \u0645\u0648\u0641\u0642\u06cc\u062a \u062e\u0637 \u0635\u0627\u0641 \u0646\u06cc\u0633\u062a. \u067e\u0631 \u0627\u0632 \u062f\u0633\u062a\u200c\u0627\u0646\u062f\u0627\u0632\u0647.","\u062a\u0648\u06cc \u0631\u0648\u0632\u0647\u0627\u06cc \u062e\u0627\u06a9\u0633\u062a\u0631\u06cc \u0647\u0645 \u0631\u0646\u06af\u06cc\u0646\u200c\u06a9\u0645\u0648\u0646 \u0628\u0627\u0634.","\u0627\u0646\u0636\u0628\u0627\u0637 \u06cc\u0639\u0646\u06cc: \u0627\u0646\u062c\u0627\u0645\u0634 \u0628\u062f\u0647\u060c \u0686\u0647 \u0628\u062e\u0648\u0627\u06cc \u0686\u0647 \u0646\u062e\u0648\u0627\u06cc.","\u062a\u0648 \u0646\u0627\u062e\u062f\u0627\u06cc \u06a9\u0634\u062a\u06cc \u062e\u0648\u062f\u062a\u06cc. \u0646\u0630\u0627\u0631 \u0637\u0648\u0641\u0627\u0646 \u063a\u0631\u0642\u0650\u062a \u06a9\u0646\u0647.","\u062a\u0644\u0627\u0634\u062a \u0631\u0648 \u0636\u0631\u0628\u062f\u0631 \u06f2 \u06a9\u0646\u060c \u0628\u0647\u0648\u0646\u0647\u200c\u0647\u0627\u062a \u0631\u0648 \u062a\u0642\u0633\u06cc\u0645 \u0628\u0631 \u06f2.","\u0639\u0631\u0642\u0650 \u062a\u0644\u0627\u0634\u060c \u062a\u0646\u0647\u0627 \u0686\u06cc\u0632\u06cc\u0647 \u06a9\u0647 \u0628\u0648\u06cc \u0645\u0648\u0641\u0642\u06cc\u062a \u0645\u06cc\u062f\u0647.","\u0628\u0647 \u062e\u0648\u062f\u062a \u0631\u062d\u0645 \u0646\u06a9\u0646. \u0622\u06cc\u0646\u062f\u0647\u200c\u062a \u0628\u0647 \u0627\u06cc\u0646 \u0633\u062e\u062a\u200c\u06af\u06cc\u0631\u06cc \u0646\u06cc\u0627\u0632 \u062f\u0627\u0631\u0647.","\u0631\u0642\u06cc\u0628\u062a \u0627\u0644\u0627\u0646 \u062f\u0627\u0631\u0647 \u0635\u0641\u062d\u0647 \u0628\u0639\u062f\u06cc \u0631\u0648 \u0648\u0631\u0642 \u0645\u06cc\u200c\u0632\u0646\u0647.","\u0633\u062e\u062a\u06cc\u200c\u0647\u0627 \u0645\u062b\u0644 \u0648\u0632\u0646\u0647\u200c\u0627\u0646. \u0647\u0631\u0686\u06cc \u0633\u0646\u06af\u06cc\u0646\u200c\u062a\u0631\u060c \u062a\u0648 \u0642\u0648\u06cc\u200c\u062a\u0631.","\u062a\u0648 \u06cc\u0647 \u0627\u0644\u0645\u0627\u0633\u06cc. \u0641\u0634\u0627\u0631 \u0641\u0642\u0637 \u0628\u0627\u0639\u062b \u0645\u06cc\u0634\u0647 \u06af\u0631\u0648\u0646\u200c\u062a\u0631 \u0628\u0634\u06cc.","\u0627\u062c\u0627\u0632\u0647 \u0646\u062f\u0647 \u06cc\u0647 \u0622\u0632\u0645\u0648\u0646 \u0628\u062f\u060c \u06a9\u0644 \u0647\u0641\u062a\u0647\u200c\u062a \u0631\u0648 \u062e\u0631\u0627\u0628 \u06a9\u0646\u0647.","\u0645\u0648\u0641\u0642\u06cc\u062a \u0627\u062c\u0627\u0631\u0647\u200c\u0627\u06cc\u0647\u060c \u0648 \u0627\u062c\u0627\u0631\u0647\u200c\u0634 \u0631\u0648 \u0628\u0627\u06cc\u062f \u0647\u0631 \u0631\u0648\u0632 \u067e\u0631\u062f\u0627\u062e\u062a \u06a9\u0646\u06cc.","\u0633\u0631\u062a \u0631\u0648 \u0628\u0646\u062f\u0627\u0632 \u067e\u0627\u06cc\u06cc\u0646 \u0648 \u06a9\u0627\u0631 \u06a9\u0646. \u0648\u0642\u062a \u0628\u0631\u0627\u06cc \u062c\u0634\u0646 \u06af\u0631\u0641\u062a\u0646 \u0647\u0633\u062a.","\u0646\u0630\u0627\u0631 \u0635\u062f\u0627\u06cc \xab\u0646\u0645\u06cc\u200c\u062a\u0648\u0646\u06cc\xbb \u062a\u0648\u06cc \u0633\u0631\u062a \u0628\u0644\u0646\u062f \u0628\u0634\u0647.","\u062a\u0648 \u062f\u0627\u0631\u06cc \u062a\u0627\u0631\u06cc\u062e\u0686\u0647 \u062e\u0627\u0646\u0648\u0627\u062f\u06af\u06cc\u062a \u0631\u0648 \u062a\u063a\u06cc\u06cc\u0631 \u0645\u06cc\u062f\u06cc.","\u06cc\u0647 \u0631\u0648\u0632\u06cc \u0627\u06cc\u0646 \u06a9\u062a\u0627\u0628\u200c\u0647\u0627 \u0631\u0648 \u0645\u06cc\u200c\u0628\u0646\u062f\u06cc \u0648 \u062f\u0644\u062a \u0628\u0631\u0627\u0634\u0648\u0646 \u062a\u0646\u06af \u0646\u0645\u06cc\u0634\u0647!","\u0641\u0642\u0637 \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u0647. \u0645\u0639\u062c\u0632\u0647 \u062a\u0648\u06cc \u0642\u062f\u0645 \u0628\u0639\u062f\u06cc\u0647.","\u062a\u0648\u06cc \u062a\u0627\u0631\u06cc\u06a9\u06cc \u0647\u0645 \u0645\u06cc\u0634\u0647 \u0633\u062a\u0627\u0631\u0647\u200c\u0647\u0627 \u0631\u0648 \u062f\u06cc\u062f.","\u062a\u0628\u062f\u06cc\u0644 \u0634\u0648 \u0628\u0647 \u06a9\u0633\u06cc \u06a9\u0647 \u0647\u06cc\u0686\u06a9\u0633 \u0641\u06a9\u0631\u0634 \u0631\u0648 \u0646\u0645\u06cc\u200c\u06a9\u0631\u062f.","\u0627\u0648\u062c\u0650 \u0633\u062e\u062a\u06cc\u060c \u062f\u0642\u06cc\u0642\u0627\u064b \u0642\u0628\u0644 \u0627\u0632 \u0622\u0633\u0648\u0646\u06cc\u0647.","\u062a\u0648 \u0633\u0627\u062e\u062a\u0647 \u0634\u062f\u06cc \u0628\u0631\u0627\u06cc \u06a9\u0627\u0631\u0647\u0627\u06cc \u0628\u0632\u0631\u06af.","\u0631\u0648\u0632\u0647\u0627\u06cc \u0633\u062e\u062a \u0642\u06cc\u0645\u062a \u062a\u0648 \u0631\u0648 \u062a\u0639\u06cc\u06cc\u0646 \u0645\u06cc\u200c\u06a9\u0646\u0646.","\u0628\u0647 \u0639\u0642\u0628 \u0646\u06af\u0627\u0647 \u0646\u06a9\u0646\u060c \u062a\u0648 \u0627\u0648\u0646 \u0637\u0631\u0641\u06cc \u0646\u0645\u06cc\u0631\u06cc.","\u0627\u0645\u0631\u0648\u0632\u062a \u0631\u0648 \u0642\u0631\u0628\u0627\u0646\u06cc \u0641\u0631\u062f\u0627\u062a \u06a9\u0646. \u0645\u06cc\u200c\u0627\u0631\u0632\u0647.","\u062e\u0633\u062a\u0647\u200c\u0645\u061f \u0622\u0631\u0647. \u062a\u0633\u0644\u06cc\u0645 \u0645\u06cc\u200c\u0634\u0645\u061f \u0647\u0631\u06af\u0632.","\u062a\u0648\u06cc \u0633\u06a9\u0648\u062a \u0628\u0633\u0627\u0632\u060c \u0628\u0630\u0627\u0631 \u0628\u0642\u06cc\u0647 \u0641\u06a9\u0631 \u06a9\u0646\u0646 \u062f\u0627\u0631\u06cc \u0645\u06cc\u200c\u0628\u0627\u0632\u06cc.","\u0627\u06cc\u0646 \u0641\u0642\u0637 \u06cc\u0647 \u0627\u0645\u062a\u062d\u0627\u0646\u0647\u060c \u0646\u0647 \u067e\u0627\u06cc\u0627\u0646 \u062f\u0646\u06cc\u0627. \u0648\u0644\u06cc \u0628\u0647\u062a\u0631\u06cc\u0646 \u0627\u0645\u062a\u062d\u0627\u0646\u062a \u0631\u0648 \u0628\u062f\u0647.","\u0633\u0642\u0641 \u0631\u0648\u06cc\u0627\u0647\u0627\u062a \u0631\u0648 \u0646\u0630\u0627\u0631 \u067e\u0627\u06cc\u06cc\u0646 \u0628\u06cc\u0627\u062f\u060c \u062a\u0644\u0627\u0634\u062a \u0631\u0648 \u0628\u0628\u0631 \u0628\u0627\u0644\u0627.","\u062a\u0648 \u0645\u0639\u062c\u0632\u0647\u200c\u06cc \u062e\u0648\u062f\u062a\u06cc.","\u0647\u0631 \u0631\u0648\u0632\u06cc \u06a9\u0647 \u062f\u0631\u0633 \u0645\u06cc\u200c\u062e\u0648\u0646\u06cc\u060c \u06cc\u0647 \u0633\u06cc\u0644\u06cc \u0628\u0647 \u0646\u0627\u0627\u0645\u06cc\u062f\u06cc\u0647.","\u0628\u0631\u0646\u062f\u0647 \u0627\u0648\u0646\u06cc\u0647 \u06a9\u0647 \u0648\u0642\u062a\u06cc \u062f\u0631\u062f \u062f\u0627\u0631\u0647 \u0647\u0645 \u0627\u062f\u0627\u0645\u0647 \u0645\u06cc\u062f\u0647.","\u0644\u0630\u062a \u062e\u0648\u0627\u0628 \u0635\u0628\u062d \u0631\u0648 \u0628\u0627 \u0644\u0630\u062a \u0642\u0628\u0648\u0644\u06cc \u0639\u0648\u0636 \u0646\u06a9\u0646.","\u06cc\u0647 \u0631\u0648\u0632\u06cc \u062f\u0644\u062a \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0631\u0648\u0632\u0627\u06cc \u0633\u062e\u062a \u062a\u0646\u06af \u0645\u06cc\u0634\u0647\u060c \u0686\u0648\u0646 \u062a\u0648 \u0631\u0648 \u0633\u0627\u062e\u062a\u0646.","\u0628\u0647 \u0635\u0646\u062f\u0644\u06cc \u062e\u0627\u0644\u06cc \u062f\u0627\u0646\u0634\u06af\u0627\u0647 \u0641\u06a9\u0631 \u06a9\u0646 \u06a9\u0647 \u0645\u0646\u062a\u0638\u0631 \u062a\u0648\u0626\u0647.","\u062f\u0646\u06cc\u0627 \u0628\u0647 \u0622\u062f\u0645\u200c\u0647\u0627\u06cc \u0645\u0639\u0645\u0648\u0644\u06cc \u067e\u0627\u062f\u0627\u0634 \u0645\u0639\u0645\u0648\u0644\u06cc \u0645\u06cc\u062f\u0647. \u062a\u0648 \u062e\u0627\u0635 \u0628\u0627\u0634.","\u0647\u0631 \u0634\u0628 \u0627\u0632 \u062e\u0648\u062f\u062a \u0628\u067e\u0631\u0633: \u0627\u0645\u0631\u0648\u0632 \u0628\u0631\u0627\u06cc \u0631\u0648\u06cc\u0627\u0647\u0627\u0645 \u0686\u06cc\u06a9\u0627\u0631 \u06a9\u0631\u062f\u0645\u061f","\u062a\u0646\u0628\u0644\u06cc \u0631\u0648 \u0647\u0645\u06cc\u0646 \u0627\u0644\u0627\u0646 \u0627\u062e\u0631\u0627\u062c \u06a9\u0646. \u062a\u0648 \u0631\u0626\u06cc\u0633 \u0632\u0646\u062f\u06af\u06cc \u062e\u0648\u062f\u062a\u06cc.","\u06cc\u0647 \u0642\u0647\u0631\u0645\u0627\u0646\u060c \u062d\u062a\u06cc \u0648\u0642\u062a\u06cc \u0632\u062e\u0645\u06cc\u0647 \u0647\u0645 \u0645\u06cc\u200c\u062c\u0646\u06af\u0647.","\u0686\u0634\u0645\u0627\u062a \u0631\u0648 \u0628\u0628\u0646\u062f \u0648 \u0644\u062d\u0638\u0647 \u0627\u0639\u0644\u0627\u0645 \u0646\u062a\u0627\u06cc\u062c \u0631\u0648 \u0628\u0628\u06cc\u0646. \u062d\u0627\u0644\u0627 \u0686\u0634\u0645\u0627\u062a \u0631\u0648 \u0628\u0627\u0632 \u06a9\u0646 \u0648 \u0628\u062e\u0648\u0646.","\u0646\u0630\u0627\u0631 \u0645\u0648\u0628\u0627\u06cc\u0644\u062a \u062a\u0648 \u0631\u0648 \u06a9\u0646\u062a\u0631\u0644 \u06a9\u0646\u0647. \u062e\u0627\u0645\u0648\u0634\u0634 \u06a9\u0646 \u0648 \u067e\u0631\u0648\u0627\u0632 \u06a9\u0646.","\u062a\u0648\u06cc \u0633\u06a9\u0648\u062a \u0631\u0634\u062f \u06a9\u0646. \u0646\u06cc\u0627\u0632\u06cc \u0646\u06cc\u0633\u062a \u0628\u0647 \u0647\u0645\u0647 \u062a\u0648\u0636\u06cc\u062d \u0628\u062f\u06cc.","\u0627\u0645\u0631\u0648\u0632 \u0633\u062e\u062a\u200c\u062a\u0631 \u06a9\u0627\u0631 \u06a9\u0646\u060c \u0641\u0631\u062f\u0627 \u0631\u0627\u062d\u062a\u200c\u062a\u0631 \u0632\u0646\u062f\u06af\u06cc \u06a9\u0646.","\u062a\u0648 \u06cc\u0647 \u0627\u0644\u0645\u0627\u0633\u06cc \u06a9\u0647 \u0632\u06cc\u0631 \u0641\u0634\u0627\u0631 \u062f\u0627\u0631\u06cc \u0634\u06a9\u0644 \u0645\u06cc\u200c\u06af\u06cc\u0631\u06cc.","\u0647\u06cc\u0686 \u062a\u0644\u0627\u0634\u06cc \u06af\u0645 \u0646\u0645\u06cc\u0634\u0647. \u06a9\u0627\u0626\u0646\u0627\u062a \u062f\u0627\u0631\u0647 \u062d\u0633\u0627\u0628 \u06a9\u062a\u0627\u0628 \u0645\u06cc\u200c\u06a9\u0646\u0647.","\u0648\u0642\u062a\u06cc \u0647\u0645\u0647 \u062f\u0627\u0631\u0646 \u0627\u0633\u062a\u0631\u0627\u062d\u062a \u0645\u06cc\u200c\u06a9\u0646\u0646\u060c \u0632\u0645\u0627\u0646 \u0637\u0644\u0627\u06cc\u06cc \u062a\u0648\u0626\u0647.","\u0628\u0647\u062a\u0631\u06cc\u0646 \u0648\u0631\u0698\u0646 \u062e\u0648\u062f\u062a \u0628\u0627\u0634\u060c \u0646\u0647 \u06a9\u067e\u06cc \u0628\u0642\u06cc\u0647.","\u0628\u0627 \u0627\u0646\u06af\u06cc\u0632\u0647 \u0634\u0631\u0648\u0639 \u06a9\u0646\u060c \u0628\u0627 \u0639\u0627\u062f\u062a \u0627\u062f\u0627\u0645\u0647 \u0628\u062f\u0647.","\u062a\u0648 \u0641\u0642\u0637 \u06cc\u06a9 \u0628\u0627\u0631 \u0627\u06cc\u0646 \u0633\u0646 \u0648 \u0633\u0627\u0644 \u0631\u0648 \u062f\u0627\u0631\u06cc. \u0646\u0630\u0627\u0631 \u0628\u0627 \u062d\u0633\u0631\u062a \u0628\u06af\u0630\u0631\u0647.","\u0645\u0648\u0641\u0642\u06cc\u062a \u0645\u0646\u062a\u0638\u0631 \u06a9\u0633\u06cc \u0646\u0645\u06cc\u0645\u0648\u0646\u0647. \u0628\u062f\u0648 \u062f\u0646\u0628\u0627\u0644\u0634.","\u06cc\u0647 \u0631\u0648\u0632 \u062e\u0648\u0628 \u0646\u0645\u06cc\u0627\u062f\u060c \u06cc\u0647 \u0631\u0648\u0632 \u062e\u0648\u0628 \u0633\u0627\u062e\u062a\u0647 \u0645\u06cc\u0634\u0647. \u0628\u0633\u0627\u0632\u0634.","\u0627\u062c\u0627\u0632\u0647 \u0646\u062f\u0647 \u062a\u0631\u0633 \u0627\u0632 \u0634\u06a9\u0633\u062a\u060c \u062a\u0648 \u0631\u0648 \u0627\u0632 \u0634\u0631\u0648\u0639 \u06a9\u0631\u062f\u0646 \u0628\u0627\u0632 \u062f\u0627\u0631\u0647.","\u062a\u0648\u06cc \u0622\u06cc\u0646\u0647 \u0646\u06af\u0627\u0647 \u06a9\u0646. \u0627\u06cc\u0646 \u062a\u0646\u0647\u0627 \u0631\u0642\u06cc\u0628 \u062a\u0648\u0626\u0647."],t.s)
